import './App.css';
import CreatePostForm from './components/CreatePostForm';
import CreateItem from './pages/admin/CreateItem';
import NavBar from './components/NavBar';
import HomePage from './pages/HomePage';

function App() {
  return (
    <Router>
    <div className="App">
        <Nav />

        <Switch>
          <Route path="/" exact component={Home} />
          <Route path="/manage-puns" component={ManagePuns} />
          {/* 
                Make sure to specify the parameter ":id" in the URL
                This will ensure that UpdatePun.js gets hold of the punId, through the variable "match"
            */}
          <Route path="/update-pun/:id" component={UpdatePun} />
          <Route path="/create-pun" component={CreatePun} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
